import styled from "styled-components";

export const InfoWrapper = styled.div``;

export const InfoList = styled.ul`
  display: flex;
  gap: 8px;
  flex-wrap: wrap;
  list-style: none;
  margin-bottom: 24px;
`;

export const InfoItem = styled.li`
  display: flex;
  padding: 12px 18px;
  align-items: center;
  border-radius: 100px;
  background: #f2f4f7;
  mix-blend-mode: multiply;
`;

export const InfoImg = styled.img`
  width: 20px;
  height: 20px;
  margin-right: 8px;
`;
